Zapraszamy na debatę: Polska co dalej?

Już dziś o godzinie 22:10 na TVP1 odbędzie się emisja debaty z cyklu „Polska. Co dalej?”, organizowanej przez TVP we współpracy z SGH. Poruszymy bardzo ważny temat: „Czy powinniśmy przyjmować uchodźców?”

Dołącz do nas, aby poznać różne perspektywy na ten ważny społecznie i politycznie temat!

Prowadzący: Dominika Komarnicka, Kacper Zembrzucki, Igor Demianiuk,. 

