Studenci organizujący tegoroczne @juwenalia_sgh przypominają jednak o zasadach obowiązujacych podczas wydarzenia, byście wszyscy mogli bawić się bezpiecznie. Poniżej szczegóły:

🎵 Otwarcie bramek: 15:00

🎟 Wejście jednorazowe z biletem elektronicznym 

Ważne jest posiadanie elektronicznego biletu. Pamiętajcie o tym, że wejście na teren wydarzenia jest jednorazowe.

🚫 Zakaz wnoszenia jedzenia i picia

👨‍👦 Macie mniej niż 16 lat?

Potrzebujecie zgody swojego rodzica lub opiekuna, aby wejść na teren imprezy, co więcej, zgodnie z regulaminem, osoby poniżej 16. roku życia muszą przebywać na Juwenaliach jedynie pod opieką pełnoletniego opiekuna.

🔐 Wejście z dowodem tożsamości 

Przy wejściu na koncert prosimy o okazanie dowodu tożsamości. To ważne dla nas wszystkich, abyśmy mogli stworzyć bezpieczne i komfortowe środowisko dla każdego uczestnika.

🚫 Zakaz wprowadzania zwierząt

